import React from 'react'
import { Link } from "react-router-dom";


function StudentDashboard() {
  return (
    <div>
      <h1> This is the Student's Dashboard</h1>
      <Link to = "/"> To HOME  </Link> 
      <Link to = "Random"> </Link>
    </div>
  )
}

export default StudentDashboard
